    false,nt"url": null,nt"notes": "The 2015 TIGER Geodatabases are extracts
    of selected nation based and state based geographic and cartographic information
    from then                    U.S. Census Bureau's Master Address File/Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) database. The geodatabasesn
                       include feature class layers of information for the fifty states,
    the District of Columbia, Puerto Rico, and the Island areas (American Samoa, the
    n                    Commonwealth of the Northern Mariana Islands, Guam, and the
    United States Virgin Islands). The geodatabases do not contain any sensitive data.
    The n                    2015 TIGER Geodatabases are designed for use with Esriu00e2u0080u0099s
    ArcGIS. n                    n                    The Linear Hydrography National
    Geodatabase contains all linear hydrography (rivers, streams, etc.) for the nation.
    Linear Watern                    Features includes single-line drainage water features
    and artificial path features that run through double-line drainage features such
    as rivers andn                    streams, and serve as a linear representation
    of these features.  The artificial path features may correspond to those in the
    USGS Nationaln                    Hydrographic Dataset (NHD).  However, in many
    cases the features do not match NHD equivalent feature and will not carry the NHD
    metadata codes.n                    These features have a MAF/TIGER Feature Classification
    Code (MTFCC) beginning with an "H" to indicate the super class of Hydrographic
    Features.n                ",nt"license_title": null,nt"extras": [{ntt"key":
